import React from 'react';
import "./Pages.css"

const Skills = () => {
    return (
    <div>
        <h1 className='title'>Skills and Certifications</h1>
        <h3 className='body'>This page details my skills and certifications</h3>
    </div>
    );
}
export default Skills;
